import React, { Component } from 'react';
import Chart from 'react-apexcharts'
import api from '../services/api'

class Donut extends Component {

  async componentDidMount() {
    const response = await api.get('/novos');

        response.data.map( (dados) => (
          this.state.series.push(dados['total'])
            (dados['mes'] === '01') ? this.state.options['labels'].push('Jeneiro'): '',
            (dados['mes'] === '02') ? this.state.options['labels'].push('Fevereiro') : '',
            (dados['mes'] === '03') ? this.state.options['labels'].push('Marco') : '',
            (dados['mes'] === '04') ? this.state.options['labels'].push('Abril') : '',
            (dados['mes'] === '05') ? this.state.options['labels'].push('Maio') : '',
            (dados['mes'] === '06') ? this.state.options['labels'].push('Junho') : '',
            (dados['mes'] === '07') ? this.state.options['labels'].push('Julho') : '',
            (dados['mes'] === '08') ? this.state.options['labels'].push('Agosto') : '',
            (dados['mes'] === '09') ? this.state.options['labels'].push('Setembro') : '',
            (dados['mes'] === '10') ? this.state.options['labels'].push('Outubro') : '',
            (dados['mes'] === '11') ? this.state.options['labels'].push('Novembro') : '',
            (dados['mes'] === '12') ? this.state.options['labels'].push('Dezembro') : ''
        ))

  }

  constructor(props) {
    super(props);

    this.state = {
      options: {
          labels: []
        },
      series: []     
    }
  }

  render() {

    return (
      <div className="donut">
        <Chart options={this.state.options} width="380" series={this.state.series} type="donut" />
      </div>
    );
  }
}

export default Donut;
